import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import "./assets/Location.css";

const Location = () => {
  return (
    <Background>
      <Container>
        <Title>여기어디</Title>

        <div class="balloon1">
          <h6>너.. 지금 어디야? 못 찾겠어 😭</h6>
        </div>
        <div class="balloon2">
          <h6>
            🎤 현재 위치는 부산시 … <br />
            w3w주소 : 날개.휴업.어묵 <br />
            위도 : 129.09343339999998 <br />
            경도 : 35.2296821 … <br />
            <br />
            여기로 와!
          </h6>
        </div>
        <Button>
          <Started to="/map">내 위치 알아보기</Started>
        </Button>
      </Container>
    </Background>
  );
};

const Background = styled.div`
  background: #ebebeb 0% 0% no-repeat padding-box;
  border-radius: 30px;
  position: absolute;
  top: 200px;
  left: 50%;
  transform: translateX(-50%);
  box-shadow: 3px 3px 15px #e6e6e6;
  width: 428px;
  height: 926px;
`;

const Container = styled.div`
  border: 1px solid red;
  margin-left: 20px;
  margin-right: 20px;
  margin-top: 20px;
`;

const Title = styled.h5`
  margin-bottom: 25px;
  border: 1px solid red;
  width: 30px;
  font-size: 30px;
  font-weight: 600;
  align-items: center;
  font-family: "Poppins", sans-serif;
`;

const SubTitle = styled.h3`
  margin-bottom: 3px;
  font-size: 24px;
`;

const MainTitle = styled.h2`
  margin-top: 0;
  font-size: 30px;
`;

const Button = styled.div`
  background: #000000;
  width: 388px;
  height: 60px;
  position: relative;
  top: 150px;
  z-index: 1;
  border: none;
  border-radius: 20px 20px 0px 20px;
  font-size: 24px;
  font-family: "Poppins", sans-serif;
  text-align: center;

  &: hover {
    background: #5ba562;
  }
`;

const Started = styled(Link)`
  color: white;
  text-decoration: none;
`;

export default Location;
